import React from 'react';

function InfoCard(props) {
    const infoCardStyle = {
        textAlign: "center"
    };
    return (
        <div style={ infoCardStyle }>
            <a href={ props.link }>
                <img src={ props.img } />
                <div>
                    <h4>
                        { props.title }
                    </h4>
                    <p>
                        { props.note }
                    </p>
                </div>
            </a>
        </div>
    );
};
export default InfoCard;
